import * as React from 'react'

class Body extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      button: 'Connect',
      isLogged: false,
    }
  }

  handleClick() {
    this.setState({ isLogged: true })
    this.setState({ button: 'Buy product' })
  }

  render() {
    return (
      <>
        <div className="col-sm">
          <button
            id="button-addon2"
            type="button"
            className="btn btn-buy"
            onClick={() => this.handleClick}
          >
            {this.state.button}
          </button>
        </div>
        <div className="col-sm">
          <button
            id="button-addon2"
            type="button"
            className="btn btn-buy"
            onClick={() => this.handleClick}
          >
            {this.state.button}
          </button>
        </div>
        <div className="col-sm">
          <button
            id="button-addon2"
            type="button"
            className="btn btn-buy"
            onClick={() => this.handleClick}
          >
            {this.state.button}
          </button>
        </div>
        <div className="col-sm">
          <button
            id="button-addon2"
            type="button"
            className="btn btn-buy"
            onClick={() => this.handleClick}
          >
            {this.state.button}
          </button>
        </div>
      </>
    )
  }
}

export default Body
